import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Treatment from './pages/Treatment';
import Blogs from './pages/Blogs';
import AboutMe from './pages/AboutMe';
import { useState } from 'react';
import TreatmentDetails from './pages/TreatmentDetails';
import BlogDetails from './pages/BlogDetails';
import HomeCompBlog from './components/HomeCompBlog';
import HomeCompTreat from './components/HomeCompTreat';

function App() {
  const [treat, setTreat] = useState("");
  const [blog, setBlog] = useState("");
  const [homeTreat, setHomeTreat] = useState("");
  const [homeBlog, setHomeBlog] = useState("");
  console.log(treat);
  console.log(homeBlog);
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path="treatment" element={<Treatment setTreat={setTreat} />} />
          <Route path="blogs" element={<Blogs setBlog={setBlog} />} />
          <Route path="about-me" element={<AboutMe />} />
          <Route path="/treatment-details" element={<TreatmentDetails data={treat} homedata={treat}  />} />
          <Route path="/blogs-details" element={<BlogDetails data={blog} homedata={blog}/>} />
          <Route path="/treatment-details" element={<HomeCompTreat setHomeTreat={setHomeTreat} />} />
          <Route path="/blogs-details" element={<HomeCompBlog  />} setHomeBlog={setHomeBlog} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
